import React from "react";
import "../css-components/technologies.css";
import git from "../images/git.png";
import gitHub from "../images/github.png";
import js from "../images/js.png";
import node from "../images/node.png";
import postgres from "../images/postgres.png";
import react from "../images/react.png";
import wordpress from "../images/wordpress.png";
import html from "../images/html.png";
import css from "../images/css.png";
import materialUI from "../images/material-ui.png";
import sequelize from "../images/sequelize.png";
import cloudways from "../images/cloudways.png";
import php from "../images/php.png";
import mern from "../images/mern.png";
import pern from "../images/pern.png";
import handlebars from "../images/handlebars.png";
import ejs from "../images/ejs.png";

const Technologies = () => {
  const logos = [
    git,
    gitHub,
    js,
    node,
    postgres,
    react,
    wordpress,
    html,
    css,
    materialUI,
    sequelize,
    cloudways,
    php,
    handlebars,
    ejs
  ];
  return (
    <>
      <div>
        <h5 className="title"> Technologies & Technical Skills</h5>
      </div>

      <div>
        {logos.map((logo) => (
          <img key={logo} src={logo} alt="" />
        ))}
      </div>
      <hr/>
      <div className="stacks">
      <h5 className="title"> Stacks</h5>
      <img src={mern} alt="" />
      <img src={pern} alt="" /> </div>
    </>
  );
};

export default Technologies;
